export class Portal extends React.Component {
    render() {
        return (
            < main id="portal" >
                {/* <Header /> */}
                <Route path="/newproduct" component={NewProduct} />
                <Route path="/products" component={Products} />
                <Route path="/expenses" component={Expenses} />
            </main >

        )
    }
}
